import Layout from "../layout/Layout";
import classes from "./MyProfile.module.css";
import Button from "../UI/Button/Button";
import { useState } from "react";

function MyProfile() {
  const [enableForm, setEnableForm] = useState(false);

  function onEditHandler() {
    setEnableForm(true);
  }

  return (
    <div>
      <Layout>
        <h2 className={classes.h2}>My Profile</h2>
        <div className={classes.control}>
          <label>Name : </label>
          <label>Shankar Narayanan</label>
        </div>
        <div className={classes.control}>
          <label>E-Mail : </label>
          <label>shankarvenkat0512@gmail.com</label>
        </div>
        <div className={classes.control}>
          <label>Password : </label>
          <label>Shanky@0512</label>
        </div>
        <div className={classes.control}>
          <label>Base Planet : </label>
          <label>Earth</label>
        </div>
        <div className={classes.control}>
          <label>Date of Birth : </label>
          <label>05/12/1998</label>
        </div>
        <Button className={classes.button} onClick={onEditHandler} >Edit</Button>
      </Layout>
    </div>
  );
}
export default MyProfile;
